import React from 'react'
import './Tempwelcomepage.css';

const Tempwelcomepage = () => {
  return (
    <div>
        <p className='comingsoon'>Welcome Folks We are coming soon..</p>
        <p>The courses will start soon once the minimum number of participants are reached </p>
        <p> Please make sure you are signed in to get notified..</p>
        <button>Sign Up</button>
    </div>
  )
}

export default Tempwelcomepage
